import React from 'react'
import "./index.css"
import Card from "./Card"
import Sdata from "./Sdata"

function ncard(value){
    return(
        <Card
                imgsrc={value.imgsrc}
                title={value.title}
                title1={value.title1}
        />
    )
}


const App = () => {
    return (
        <>
            
            Sdata.map(ncard)
            


        </>
    )
}

export default App
